import React, { Component } from "react";

class GameFooter extends Component {
  render() {
    return (
      <div
        style={{
          display: "flex",
          justifyContent: "center",
        }}
      >
        <form>
          <label>
            Name:
            <input type="text" name="name" />
          </label>
          <input type="submit" value="Submit" />
        </form>
        <h3>Game Footer</h3>
      </div>
    );
  }
}
export default GameFooter;
